import{_ as t,c as o,o as n,ah as r}from"./chunks/framework.PvdZnrZd.js";const c=JSON.parse('{"title":"BRING SHIPPING","description":"BRING SHIPPING","frontmatter":{"title":"BRING SHIPPING","description":"BRING SHIPPING","date":"2025-07-18T00:00:00.000Z","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/featured-app/shipping/bring-shipping.md","filePath":"zenith/featured-app/shipping/bring-shipping.md"}'),i={name:"zenith/featured-app/shipping/bring-shipping.md"};function a(l,e,s,p,g,h){return n(),o("div",null,[...e[0]||(e[0]=[r('<p><a href="/zenith/introduction/">Multi-Vendor Marketplace for Shopify</a> is here with another marketplace shipping feature app, i.e., <strong>Bring</strong>.</p><p>Using this featured app, the merchants can allow sellers to ship goods through the Bring shipping method and then print <strong>Shipping Label</strong>. Moreover, create a <strong>pickup request</strong>.</p><p><strong>CHARGES:</strong></p><p>This feature will have an additional charge of <strong>USD 10 per month</strong> over &amp; above your current multivendor marketplace plan.</p><p><strong>NOTE:</strong></p><p>This feature app is available only with the Multivendor <strong>Pro</strong> <strong>Plan</strong> ($60/month). Moreover, you need to enable the <a href="/zenith/featured-app/overview.html"><strong>Shipping</strong></a> add-on (free) from the ‘featured apps’ section of the app.</p><p>Above all, access to Shipping requires your Shopify store to be on the plan that supports <strong>Real-Time Carrier-Calculated Shipping</strong>.</p><h2 id="installation" tabindex="-1">Installation <a class="header-anchor" href="#installation" aria-label="Permalink to &quot;Installation&quot;">​</a></h2><p>Enable the following app by visiting:</p><ul><li>Multi-Vendor <strong>Admin Panel</strong></li><li>From the Dashboard, hover over the <strong>three dots</strong> on the top-right of the page</li><li>Click on <strong>Feature Apps</strong></li><li>Search for ‘<strong>Bring</strong>‘ &amp; click on ‘<strong>Enable</strong>‘</li><li>After accepting the charges, you’ll be good to configure the app!</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/enablebring.webp" alt="image-28"></p><h2 id="configuration-admin-end" tabindex="-1">Configuration: Admin End <a class="header-anchor" href="#configuration-admin-end" aria-label="Permalink to &quot;Configuration: Admin End&quot;">​</a></h2><p>Firstly, the admin needs to enable this shipping method from the shipping configuration. So, for this, visit:</p><p><strong>Multivendor Marketplace Admin Panel</strong> &gt; <strong>Configuration</strong> &gt; <strong>Shipping Configuration</strong>.</p><p>Click on the <strong>three dots</strong> under the <strong>Action</strong> menu &amp; further, click on <strong>enable</strong>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/enabletwobring.webp" alt="image-29"></p><p>Moving on, the admin needs to configure the Bring. So, for this, click on <strong>Configure Shipping</strong>. Refer:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/configureshippingbring.webp" alt="image-30"></p><h2 id="bring-shipping-configuration" tabindex="-1">Bring Shipping Configuration <a class="header-anchor" href="#bring-shipping-configuration" aria-label="Permalink to &quot;Bring Shipping Configuration&quot;">​</a></h2><p>On the following page, configure the following details:</p><ul><li>Sandbox Mode: If you want to test the functionality of this shipping method, keep the sandbox mode enabled. Remember, shipping labels won’t be generated in testing mode.</li><li>Automatic shipping label generation: By enabling this, the shipping label will be automatically generated at the tie of order fulfillment.</li><li>API Key: Enter Api Key Provided By Bring. It will be different for the Production and Development Environment.</li><li>User UID: Enter email ID linked with the Bring account.</li><li>Customer Number: Enter the customer number provided by Bring.</li><li>Parcel and Pallets: Enter PARCELS NORWAY INTERNATIONAL customer number provided by Bring.</li><li>Parcels: Enter PARCELS_NORWAY customer number provided by Bring.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/bringconfigadmin.webp" alt="image-31"></p><ul><li>Usage as: Fulfillment or Both (Fulfillment + Shipping)</li><li>Shipping label cost is borne by: Choose who will bear the shipping label charges, the admin, or the seller. (This is an extra cost apart from what the customer has paid.)</li><li>Choose carrier for shipping &amp; fulfillment</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/bringconfigadmintwo.webp" alt="image-32"></p><h2 id="set-shipping-method-for-sellers" tabindex="-1">Set Shipping Method For Sellers <a class="header-anchor" href="#set-shipping-method-for-sellers" aria-label="Permalink to &quot;Set Shipping Method For Sellers&quot;">​</a></h2><p>The admin can further set the shipping methods for his sellers. Go to <strong>multi vendor marketplace admin panel</strong> &gt; <strong>Sellers</strong> &gt; <strong>Seller Listing</strong> &gt; <strong>Edit</strong> (under <strong>Action</strong>).</p><p>On the edit seller page, the admin will have the following block from where he can enable/disable/set as default:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/setasdefaultbring.webp" alt="image-33"></p><p>Further, the admin can view all the sellers which are using this shipping method by going to <strong>multi vendor marketplace admin panel</strong> &gt; <strong>configuration</strong> &gt; <strong>Shipping</strong> <strong>Configuration</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/viewsellersbring.webp" alt="image-34"></p><p>The redirected page:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/editsellerbring.webp" alt="image-36"></p><p>Here, clicking on the ‘Edit’ button for a particular seller will redirect you to the ‘Edit Seller’ page</p><p>From where you can disable the following shipping method for that seller (as shown previously in this blog).</p><p>The admin can allow sellers to create pickup request from edit seller page:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/bringcreatepickup.webp" alt="image-46"></p><h2 id="make-shipping-address-phone-number-mandatory" tabindex="-1">Make <strong>Shipping</strong> <strong>Address Phone Number</strong> Mandatory <a class="header-anchor" href="#make-shipping-address-phone-number-mandatory" aria-label="Permalink to &quot;Make **Shipping** **Address Phone Number** Mandatory&quot;">​</a></h2><p>To use this feature add-on, the admin needs to make the <strong>shipping</strong> <strong>address phone number mandatory</strong> at the time of <strong>checkout</strong>.</p><p>So, to do this, go to <strong>Shopify Backend</strong> &gt; <strong>Settings</strong> &gt; <strong>Checkout</strong> &gt; Under <strong>Form Options</strong>, make <strong>Shipping</strong> <strong>address phone number</strong> as <strong>Required</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/demo-store-Checkout-Shopify-1200x597.png" alt="133"></p><h2 id="configuration-seller-end" tabindex="-1">Configuration: Seller End <a class="header-anchor" href="#configuration-seller-end" aria-label="Permalink to &quot;Configuration: Seller End&quot;">​</a></h2><p>Further, the seller can configuration Bring from his panel.</p><p>Go to <strong>Multi-Vendor Marketplace Seller Panel</strong> &gt; <strong>Configuration</strong> &gt; <strong>Shipping Configuration</strong>&gt; <strong>Enable</strong>/<strong>Disable</strong> the shipping:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/sellersetasdefaultbring.webp" alt="image-37"></p><p>Furthermore, the seller can set the shipping method as <strong>by-default</strong> so that every single product created by him will have <strong>Bring</strong> as the <strong>by-default shipping method</strong>.</p><p>Clicking on ‘<strong>Set As Default</strong>‘ will give you the following dialogue box:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/setasdefaultbringtwo.webp" alt="image-38"></p><p>Set Default Shipping Method For Products:</p><ul><li>For all products (old and new)</li><li>Only for new products</li><li>For products that don’t have any shipping method on</li></ul><p>If not this, the seller can set the shipping method on individual products while adding/editing them.</p><p>So, go to <strong>Multi-vendor marketplace seller panel</strong> &gt; <strong>Products</strong> &gt;<strong>Product Listing</strong> &gt; <strong>Add</strong>/<strong>Edit</strong> the Product:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/shippingmethodbring.webp" alt="image-39"></p><h3 id="global-configuration" tabindex="-1"><strong>Global Configuration</strong> <a class="header-anchor" href="#global-configuration" aria-label="Permalink to &quot;**Global Configuration**&quot;">​</a></h3><p>Further, click on the <strong>Global Configuration</strong> menu:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/globalconfigallsellerside.webp" alt="image-40"></p><p>So, from here, the seller can do the <strong>SHIPPING PACKET CONFIGURATION</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/05/image-41-1200x597.png" alt="image-41"></p><p><strong>NOTE</strong>: It is mandatory to add product weight while creating one.</p><h3 id="shopify-store-frontend" tabindex="-1">Shopify Store Frontend <a class="header-anchor" href="#shopify-store-frontend" aria-label="Permalink to &quot;Shopify Store Frontend&quot;">​</a></h3><p>Likewise, the customer will have an option to select the shipping method as per configured from the backend after entering the information:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/05/image-43.png" alt="image-43"></p><h2 id="shipping-label-generation" tabindex="-1">Shipping Label Generation <a class="header-anchor" href="#shipping-label-generation" aria-label="Permalink to &quot;Shipping Label Generation&quot;">​</a></h2><p>Seller will have an option to generate the shipping label from their seller panel. Also, shipping labels can only be generated for <strong>fulfilled orders</strong>.</p><p><strong>Fulfilling order via Bring</strong>:</p><p>Go to <strong>Multi-vendor marketplace seller panel</strong> &gt; <strong>Orders</strong> &gt; <strong>Order Listing</strong> &gt; <strong>View</strong> (under <strong>Action</strong>). Select the method of order fulfillment as <strong>Bring</strong> and fulfill the order.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/orderfullpage.webp" alt="image-42"></p><p>Furthermore, this is how the shipping label will be downloaded in pdf form:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/05/image-45.png" alt="image-45"></p><h2 id="create-a-pickup-request" tabindex="-1">Create A Pickup Request <a class="header-anchor" href="#create-a-pickup-request" aria-label="Permalink to &quot;Create A Pickup Request&quot;">​</a></h2><p>The seller can generate a pickup request for the Bring services to pick the order from your warehouse:</p><p>For this, go to ADDITIONAL ORDER DETAILS, click on <strong>Actions</strong> &gt; <strong>Create Pickup Request</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/generateshiipinglabel.webp" alt="image-49"></p><p>This action will give you a pop-up:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/05/image-50.png" alt="image-50"></p><p>Further, the seller can view the generated pickup request on the same page under PICKUP REQUEST DETAILS section:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/05/image-51-1200x597.png" alt="image-51"></p>',76)])])}const u=t(i,[["render",a]]);export{c as __pageData,u as default};
